import React from 'react';

function App() {
  return (
    <div className="App">
      <ul className="navbar-dark">
        <li className="nav-item">
          <a className="nav-link" href="#">Active</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#">Link</a>
        </li>
      </ul>
    </div>
  );
}

export default App;
